import React from 'react';

export default function Usuarios() {
  return (
    <div className="p-8">
      <h1 className="text-2xl font-bold mb-4">Gestión de Usuarios</h1>
      <p>Aquí el administrador podrá gestionar usuarios y roles.</p>
    </div>
  );
}
